  [],\n\t\"revision_timestamp\": \"2015-05-07T01:23:11.227341\",\n\t\"name\": \"ground-processing-optimization-using-artificial-intelligence-techniques-project-315b9\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The ultimate goal is the automation of a
  large amount of KSC's planning, scheduling, and execution decision making.  Phase
  II will result in a complete full-scale implementation of a general framework and
  its application to several problems at KSC to create several operational systems
  (e.g., for Ground Processing (GP) and the Cryogenic Test Bed (CTB)) and other systems
  targeting future, advanced applications (e.g., autonomous cryogenic operations).
  \ During Phase II, delivered applications will improve scheduling of SLS Processing
  and V&amp;V activity, including reduced scheduler manpower, reduced turnaround time
  in response to changes and what-ifs, and more optimal schedules; improve CTB Planning
  and Scheduling; and complete the diagnosis, planning, scheduling, and execution
  closed loop system for more-automatic ground and autonomous space-based cryogenic
  operations.  The KSC Engineering Development Lab has substantial development and
  testing efforts ongoing for automatically diagnosing faults in cryogenic operations.
  \ By interfacing our system to these applications, it effectively completes the
  closed loop system required for completely autonomous operations.  Our Phase II
  system will participate in a number of demonstrations during Phase II to prove the
  capabilities for future advanced more-automatic ground and space-based operations.
  \ Letters of support are included in this proposal from the managers of the groups
  that would use the operational systems in Phase II and the manager of the project
  demonstrating future, advanced applications.  This Phase II effort will also improve
  the ability of SMEs to customize intelligent scheduling systems, capture corporate
  knowledge, and implement the required interfaces to allow operational use and participation
  in cryogenic operations demonstrations.\",\n\t\"license_title\": \"U.S. Government
